import React, { Component } from 'react';
import { Switch,Route,Link } from 'react-router-dom';
import Aboutpage from './About';
import Homepage from './Homepage';
import ProductPage from './Product';

class Placeholder extends Component {
    constructor()
    {
        super();
        this.state = {id:'',name:'',price:''}
    }

    handleChange = (e) =>
    {
        this.setState({[e.target.name]:e.target.value})
    }

    render() {
        return (
            <div style={{textAlign:"Center"}}>
                <h1>Welcome to React Router</h1>
                Id: <input type="number" name="id" onChange={this.handleChange}/> <br/>
                Name: <input type="text" name="name" onChange={this.handleChange}/><br/>
                Price: <input type="number" name="price" onChange={this.handleChange}/><br/>
                <ul>
                    <li>
                        <Link to="/">Home Page</Link><br/>
                        <Link to="/about">About Page</Link><br/>
                        <Link to="/about/home">About Page</Link><br/>
                        <Link to={`/product/${this.state.id}/${this.state.name}/${this.state.price}`}>Product Page</Link>
                    </li>
                </ul>


                <Switch>
                    <Route exact path="/" component={Homepage}/>
                    <Route path="/about" component={Aboutpage}/>
                    <Route path="/product/:id/:name/:price" component={ProductPage}/>
                </Switch>
            </div>
        );
    }
}

export default Placeholder;
